import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; 

class Header extends React.Component{
    render(){
        return(
        <div className='header'>
            <h1>Last.fm</h1>
        </div>
        )
    }
}

class Main extends React.Component{
    render(){
        return(
            <Header />
        )
    }
}

ReactDOM.render(<Main />, document.getElementById('root'));
